import React from "react";
import { Link } from "react-router-dom";
import style from "./Home.module.css"


export default function Home() {
    return (
        <div>
            <h1 className={style.title}>Weather App</h1>
            <img src="https://e7.pngegg.com/pngimages/831/16/png-clipart-inside-weather-look-at-weather-drum-set-text-cloud.png"/>
            <Link to="/search"><button className={style.btn}>HOME</button></Link>
        </div>
    )
}
